let persons = [];
console.log(names.length);
names = names.slice(53000,54583);

names.forEach(name => {
  const n = name.name.replaceAll(" ", "+").trim();
  fetch('http://api.themoviedb.org/3/search/person?api_key=119bba3b76be0064555af88e9d7402ee&query=' + n)
  .then(response => response.json())
  .then(data => {
    if (data.results[0]) {
      fetch(`http://api.themoviedb.org/3/person/${data.results[0].id}?api_key=119bba3b76be0064555af88e9d7402ee`)
      .then(response => response.json())
      .then(d => {
        if(d){
          persons.push({
            ...name,
            gender: d.gender === 1 ? "FEMALE" : "MALE",
            biography: d.biography,
            birthday: d.birthday ?? null,
            img: d.profile_path
          })
        }
      })
    }
  }).catch(err => console.log(err))
  .then(_ => {
    fs.writeFile('Output.json', JSON.stringify(persons), (err) => {
      if (err) throw err;
    })
  })
});
